import React from 'react'
import { Link } from "react-router-dom";

const DashHeader = () => {
    const removeToken = () => {
        localStorage.clear();
  };
  return (
    <header>
      <div className='app-logo'>
        <h1>Prakash</h1>
      </div>
      <div className='app-right'>
        <button  onClick={removeToken}>Log Out</button>
      </div>
    </header>
  )
}

export default DashHeader;
